const userDelete = (idUser) => {
  var requestOptions = {
    method: "DELETE",
  };

  fetch("http://localhost:3004/usuario/" + idUser, requestOptions)
    .then((response) => {
      return response.json();
    })
    .then((result) => {
      // do what you want with the response here
    });
};

export default userDelete;
